import { useHistory } from "react-router";
import { Container, Col, Row } from "react-bootstrap";

const CardPopular = (props) => {
	const { name, image, id } = props.data;
	const history = useHistory();
	return (
		<>
			<Col xs={12} md={6} lg={3} className="mb-3">
				<Container>
					<Row
						className="bg-white py-3 "
						style={{ borderRadius: 5, cursor: "pointer", minHeight: "110px" }}
						onClick={() => {
							history.push(`/restaurant/${id}`);
						}}
					>
						<Col xs={3} className="text-center">
							<div class="loader loader--style8" title="7">
								<svg
									version="1.1"
									id="Layer_1"
									xmlns="http://www.w3.org/2000/svg"
									x="0px"
									y="0px"
									width="24px"
									height="30px"
									viewBox="0 0 24 30"
									style="enable-background:new 0 0 50 50;"
								>
									<rect
										x="0"
										y="10"
										width="4"
										height="10"
										fill="#333"
										opacity="0.2"
									>
										<animate
											attributeName="opacity"
											attributeType="XML"
											values="0.2; 1; .2"
											begin="0s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
										<animate
											attributeName="height"
											attributeType="XML"
											values="10; 20; 10"
											begin="0s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
										<animate
											attributeName="y"
											attributeType="XML"
											values="10; 5; 10"
											begin="0s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
									</rect>
									<rect
										x="8"
										y="10"
										width="4"
										height="10"
										fill="#333"
										opacity="0.2"
									>
										<animate
											attributeName="opacity"
											attributeType="XML"
											values="0.2; 1; .2"
											begin="0.15s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
										<animate
											attributeName="height"
											attributeType="XML"
											values="10; 20; 10"
											begin="0.15s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
										<animate
											attributeName="y"
											attributeType="XML"
											values="10; 5; 10"
											begin="0.15s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
									</rect>
									<rect
										x="16"
										y="10"
										width="4"
										height="10"
										fill="#333"
										opacity="0.2"
									>
										<animate
											attributeName="opacity"
											attributeType="XML"
											values="0.2; 1; .2"
											begin="0.3s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
										<animate
											attributeName="height"
											attributeType="XML"
											values="10; 20; 10"
											begin="0.3s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
										<animate
											attributeName="y"
											attributeType="XML"
											values="10; 5; 10"
											begin="0.3s"
											dur="0.6s"
											repeatCount="indefinite"
										/>
									</rect>
								</svg>
							</div>
						</Col>
						<Col xs={9} className="my-auto text-center">
							<h5 className=" my-0 font-weight-bold ">{name}</h5>
						</Col>
					</Row>
				</Container>
			</Col>
		</>
	);
};

export default CardPopular;
